script: |
  super -f text -I q3271.spq | sort > q3271.out

inputs:
  - name: q3271.spq
    data: |
      SELECT ALL - col0 + - 44 FROM tab2 (FORMAT parquet) WHERE ( - ( col2 ) + + + CAST ( - - ( - - 44 ) AS INTEGER ) * col0 * ( - col2 ) * 16 + - - 78 / - 54 * col0 ) NOT BETWEEN NULL AND ( + 0 / + + col0 * - - ( + + col0 ) + 95 );
  - name: tab2

outputs:
  - name: q3271.out
    data: |
